import React from 'react';
import logo from '../../images/tamil_nadu_climate.gif';

function TamilNaduClimate() {
  //   let logo = require('/images/india_Climate.gif');

  return (
    <div style={{ height: '100%' }}>
      <img
        src={logo}
        alt='TamilNadu Climate'
        style={{ width: '100%', height: '100%' }}
      />
    </div>
  );
}

export default TamilNaduClimate;
